import React from 'react'


function About(){
    return(
       <React.Fragment>
           <h1>About</h1>
           <p>This is the Todo List app v1.0.0. An app where you can add your daily work, then mark when done or delete it. </p>
       </React.Fragment>
    )
}

export default About;
